import React from "react";



const SOCIALS = [
  {
    name: "Linkedin",
    link: "https://www.linkedin.com/in/noah-farinas-b3b9571b0/",
    photo: "./photos/linkedin.png"
  },
  {
    name: "Instagram",
    link: "https://www.instagram.com/noahhnigel/?hl=en",
    photo: "./photos/instagram.png"
  },
  {
    name: "Github",
    link: "https://github.com/noahfarinas",
    photo: "./photos/github.png"
  },
];  

const Navbar = () => {
  return (
    <header>
    <div className="navbar">
      <div className="name">
        <h1>NF</h1>
      </div>
      <div className="links">
      {SOCIALS.map((item) => (
 <a href={item.link}>
 <img src={`${item.photo}`} alt={item.name} />
</a>      ))}
      </div>
    </div>
    </header>
  );
};

export default Navbar;
